●商品サイズ：直径330x奥行47mm。●重量：910g。●材質：プラスチック枠（茶メタリック塗装光沢仕上げ）、ガラス（前面）。●電源：単3乾電池（アルカリ）x2。●機能：電波修正機能（40kHz/60kHz自動選局）、スイープセコンド、おやすみ秒針、電池切れ予告。●付属品：電池。 ●見やすさにこだわったスタンダードアナログ電波掛け時計。●電波修正機能で常に正確な時刻をお知らせします。●スイープセコンド（連続秒針）仕様なので時計の気になるコチコチ音がございません。●おやすみ秒針機能を搭載しており、光センサーの働きにより周囲が一定以下の暗さになると、自動的に秒針が止まります。 ●製品仕様・デザイン・パッケージ等は予告無しに変更になる場合がございますので予めご了承下さい。※モニター電池としてマンガン電池を利用しています<style type="text/css">
